// src/App.js
import React, { useState } from 'react';
import { Routes, Route } from 'react-router-dom';
import Home from './pages/home';
import CreateItinerary from './pages/create-itinerary';
import MyTrips from './pages/trips';
import Auth from './pages/auth-page';
import Navbar from './components/navbar';

function App() {
  const [trips, setTrips] = useState([
    { country: 'France', city: 'Paris' },
    { country: 'France', city: 'Paris' },
    // Add initial trips here if needed
  ]);

  const addDestination = (destination) => {
    setTrips([...trips, destination]);
  };

  const removeDestination = (index) => {
    const newTrips = trips.filter((_, tripIndex) => tripIndex !== index);
    setTrips(newTrips);
  };

  return (
    <div>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/create-itinerary" element={<CreateItinerary addDestination={addDestination} />} />
        <Route path="/my-trips" element={<MyTrips trips={trips} removeDestination={removeDestination} />} />
        <Route path="/auth" element={<Auth />} />
      </Routes>
    </div>
  );
}

export default App;
